import React from 'react';
import Greeting from './ejercicio-1/Greeting.js';
import ShowName from './ejercicio-1/ShowName.js';
import ShowDate from './ejercicio-1/ShowDate.js';
import ShowMessage from './ejercicio-1/ShowMessage.js';
import ShowMessage2 from './ejercicio-1/ShowMessage2.js';
import Loading from './ejercicio-2/Loading.js';
import Parent from './ejercicio-2/Parent.js';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 class="ejercicio">Ejercicio 1</h1>
        <Greeting />
        <ShowName />
        <ShowDate />
        <ShowMessage text="Hola" />
        <ShowMessage2 />
        <h1>Ejercicio 2</h1>
        <Loading show />
        <br />
        <Parent>Haz click</Parent>
      </header>
    </div>
  );
}

export default App;
